import React from 'react';
import ApiCalendar from 'react-google-calendar-api';

import {Login} from '../components/Login';

const config = {
  "clientId": process.env.REACT_APP_CLIENT_ID,
  "apiKey": process.env.REACT_APP_API_KEY,
  "scope": "https://www.googleapis.com/auth/userinfo.email https://www.googleapis.com/auth/calendar.readonly https://www.googleapis.com/auth/calendar.events https://www.googleapis.com/auth/calendar",
  "discoveryDocs": [
    "https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest"
  ]
};

var apiCalendar;

class Calendar extends React.Component {

  constructor() {
    super();
    this.state = {
      calendarData : {}
    };
  }

  componentDidMount = () => {
    apiCalendar = new ApiCalendar(config);
  }

  render() {
    return (
      <React.Fragment>
        <a href="/meeting">Meeting Page</a>
        <a href="/CalendarAPI">CalendarAPI</a>

        <p>Calendar page will contain an empty calendar which will be filled in when signed in</p>

        <button onClick={apiCalendar.handleAuthClick()}>test</button>

        <Login updateUserData={this.updateUserData} />

      </React.Fragment>
    )
  }
}

export default Calendar
